  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115295 includes chemical,
  meteorological, physical and underway - surface data collected from SOUTHERN SURVEYOR
  in the Coral Sea, Indian Ocean, South Pacific Ocean and Tasman Sea from 2012-04-11
  to 2012-07-25 and retrieved during cruise 09ST20120411, 09ST20120420, 09ST20120502,
  09ST20120512, 09ST20120607 and 09ST20120711. These data include AIR-SEA DIFFERENCE
  - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CARBON
  DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE
  TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement. These data were collected by Bronte
  Tilbrook of Commonwealth Scientific and Industrial Research Organization as part
  of the VOS_Southern_Surveyor_2012_SS2012T01, VOS_Southern_Surveyor_2012_SS2012T02,
  VOS_Southern_Surveyor_2012_SS2012T03, VOS_Southern_Surveyor_2012_SS2012V01, VOS_Southern_Surveyor_2012_SS2012V02
  and VOS_Southern_Surveyor_2012_SS2012V03 data set.nnThe Global Volunteer Observing
  Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
